import { Breadcrumb, BreadcrumbItem } from "reactstrap";


function HeaderBreadcrumb() {
  return (
    <>
    <Breadcrumb>
        <BreadcrumbItem>
        <a href="#">
            Anasayfa
        </a>
        </BreadcrumbItem>
        <BreadcrumbItem>
        <a href="#">
            Seçenekler
        </a>
        </BreadcrumbItem>
        <BreadcrumbItem active>
        Sipariş Oluştur
        </BreadcrumbItem>
    </Breadcrumb>
    </>
  );
}

export default HeaderBreadcrumb;
